// =================================================================
// 3. 上書き: frontend/src/components/InstructionComponent.js
// (安定性向上のための安全装置を追加)
// =================================================================
import React from 'react';
import { useNavigate } from 'react-router-dom';

const InstructionCard = ({ icon, title, text }) => (
    <div className="instruction-card">
        <div className="instruction-icon">{icon}</div>
        <h3 className="instruction-card-title">{title}</h3>
        <p className="instruction-card-text">{text}</p>
    </div>
);

const InstructionComponent = ({ step, onGoBack }) => {
    const navigate = useNavigate();

    // === 安全装置: stepデータがなければクラッシュしない ===
    if (!step) {
        return null;
    }

    const icons = {
        coolPlace: <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" d="M12 3v2.25m6.364.386l-1.591 1.591M21 12h-2.25m-.386 6.364l-1.591-1.591M12 18.75V21m-4.773-4.227l-1.591 1.591M5.25 12H3m4.227-4.773L5.636 5.636M15.75 12a3.75 3.75 0 11-7.5 0 3.75 3.75 0 017.5 0z" /></svg>,
        loosenClothes: <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" d="M8.25 7.5l.415-.207a.75.75 0 011.085.67V10.5m0 0h6m-6 0a.75.75 0 001.085.67l.415-.207M3.75 9.75h16.5a.75.75 0 01.75.75v7.5a.75.75 0 01-.75.75H3.75a.75.75 0 01-.75-.75v-7.5a.75.75 0 01.75-.75z" /></svg>,
        coolBody: <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" d="M2.25 15a4.5 4.5 0 004.5 4.5H18a3.75 3.75 0 001.332-7.257 3 3 0 00-2.667-5.012 5.25 5.25 0 00-9.663 3.444c-.2.032-.401.056-.602.081a4.5 4.5 0 00-2.22 8.163z" /></svg>,
        hydrate: <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={1.5} stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" d="M15.75 10.5l-3.75-3.75M15.75 10.5V6a3.75 3.75 0 10-7.5 0v4.5m11.356-1.993l1.263 12c.07.658-.463 1.243-1.119 1.243H4.25a1.125 1.125 0 01-1.12-1.243l1.264-12A1.125 1.125 0 015.513 7.5h12.974c.576 0 1.059.435 1.119 1.007zM8.25 10.5a.75.75 0 00-1.5 0v3.75a.75.75 0 001.5 0V10.5z" /></svg>
    };

    return (
        <div className="screen-container">
            <h2 className="screen-header">{step.message}</h2>
            <div className="instruction-grid">
                <InstructionCard 
                    icon={icons.coolPlace} 
                    title="涼しい場所へ避難"
                    text="エアコンが効いた室内や、風通しの良い日陰など、涼しい場所へ移動させます。"
                />
                <InstructionCard 
                    icon={icons.loosenClothes} 
                    title="衣服をゆるめる"
                    text="熱がこもらないように、ベルトやネクタイ、ボタンなどをゆるめて、風通しを良くします。"
                />
                <InstructionCard 
                    icon={icons.coolBody} 
                    title="体を冷やす"
                    text="濡らしたタオルや氷のうを、首の周り、脇の下、足の付け根に当てて、効率的に体温を下げます。"
                />
                <InstructionCard 
                    icon={icons.hydrate} 
                    title="水分を補給する"
                    text="意識がはっきりしていれば、冷たい水や経口補水液、スポーツドリンクを少しずつ飲ませます。"
                />
            </div>
            <div className="footer-actions">
                <button onClick={onGoBack} className="button button-secondary">戻る</button>
                <button onClick={() => navigate('/')} className="button button-primary">ホーム画面に戻る</button>
            </div>
        </div>
    );
};

export default InstructionComponent;
